function p_veri(password){
    return new Promise((resolve, reject) => {
        let n = password.length;
        if (n < 6 || n > 30){
            console.log(password);
            console.log("Your password needs 6 - 30 characters\n");
            resolve(false);
        }
        else if(password.search(/[a-z]/) < 0){
            console.log(password);
            console.log("Your password needs a lower case letter\n");
            resolve(false);
        }
        else if(password.search(/[A-Z]/) < 0){
            console.log(password);
            console.log("Your password needs a upper case letter\n");
            resolve(false);
        }
        else if (password.search(/[0-9]/) < 0) {
            console.log(password);
            console.log("Your password needs a number\n");
            resolve(false);
        }
        else {
            console.log(password);
            console.log("password valid\n");
            resolve(true);
        }
    });
}

